import React, { Component } from 'react'

class Page3 extends Component {
    constructor({match}){
        super()
        this.state={
            namee:match.params.username
        }
    }
    render() {
        return (
            <div>
                <h1>Page3</h1>
                <p>{this.state.name}</p>
            </div>
        )
    }
}
export default Page3
